import MainPage from "./MainPage";
import "./App.css";
import store from "./store/store";
import { Provider } from "react-redux";
import Header from "./Header";
import { useState } from "react";
var App = () => {
  var [loading, setLoading] = useState(true);
  setTimeout(() => {
    setLoading(false);
  }, 3000);
  return !loading ? (
    <Provider store={store}>
      <Header />
      <MainPage />
    </Provider>
  ) : (
    <Provider store={store}>
      <Header />
    </Provider>
  );
};
export default App;
